import React from 'react'
import {useForm} from "react-hook-form"
const Login = () => {
  const {register,handleSubmit} = useForm()
  const onSubmit =() => {}
  return (
    <div classNameName='container d-flex justify-content-center align-items-center' style={{ minHeight: "100vh" }}>
      <form classNameName='row' onSubmit={handleSubmit}>
        <div className="form-outline "  style={{border:'1px solid #555'}}>
          <i className="fas fa-exclamation-circle trailing"></i>
          <input type="text" style={{border:'1px solid #555'}} id="form1" className="form-control g" placeholder='Email' {...register("email")}/>
          <input type="text" style={{border:'1px solid #555'}} id="form1" className="form-control " />
          <label className="form-label" for="form1">Example label</label>
        </div>
      </form>
    </div>
  )
}

export default Login
